`name` VARCHAR( 50 ) NULL ,
`image` VARCHAR( 255 ) NULL ,
`url` VARCHAR( 128 ) NULL ,
PRIMARY KEY (  `id` ) ,
UNIQUE (
`badoo_id`

CREATE TABLE  `crawler`.`interest` (
`id` INT NOT NULL AUTO_INCREMENT PRIMARY KEY ,
`name` VARCHAR( 255 ) NOT NULL
) ENGINE = INNODB;
ALTER TABLE  `crawler`.`interest` ADD UNIQUE  `name` (  `name` );

CREATE TABLE  `crawler`.`user_interests` (
